The World Assembly,

[i]Acknowledging[/i] the intent behind GA#709 to protect WA employees, dismissed or active, identifiers, and merits issued by the WA from unlawful exploitation;

[i]Confused[/i] why the prohibition on misrepresentation only extends to those with the intent to harm others and ignores those with other intentions, or those with the sole intent to benefit the individual;

[i]Believing[/i] that the World Assembly is an international body whose symbols belong to no specific member;

[i]Concerned[/i] about the excessiveness of trademarking all WA UI in all member and non-member states with a trademarking program;

[i]Understanding[/i] that while trademarking may serve as a tool to limit misrepresentation of the WA, in certain jurisdictions including non-member states which are not bound by extant WA resolutions, it will restrict freedom of expression and art;

[i]Alarmed[/i] that non member-states have access to registers regarding WA Personnel, as defined in the target resolution, without the same rigorous &#147;need to know basis&#148; requirements established for member-states;

Hereby repeals GA#709 &#147;WA Misrepresentation Protocols&#148;.
